I microrganismi patogeni (detti anche semplicemente agenti patogeni) sono agenti biologici responsabili dell'insorgenza della condizione di malattia nell'organismo ospite. Si distinguono in: 
*  Virus 
*  Procarioti: batteri 
*  Eucarioti: miceti e protozoi La patogenicità (ovvero la capacità generica di determinare uno stato morboso) è definita da due fattori: 
*  virulenza, che indica la maggiore o minore capacità di generare malattia;  
*  invasività, ossia la capacità di invadere i tessuti dell'ospite e moltiplicarsi all'interno. L'invasività, a sua volta, dipende da fattori quali: 
*  adesività, cioè la capacità del patogeno di legarsi con le sue strutture esterne superficiali ai siti recettoriali delle cellule dell'ospite;  
*  produzione di enzimi extracellulari che facilitano la distruzione dei tessuti dell'ospite; 
*  produzione di sostanze antifagocitarie o presenza di capsula antifagocitaria, che consentono al patogeno di resistere ai meccanismi di difesa dell'ospite.
